// components/Navbar.tsx
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-primary text-white py-4 md:py-6 lg:py-8">
      <div className="container mx-auto flex justify-between md:flex-row flex-col">
        <ul className="flex items-center space-x-4 md:space-x-8 lg:space-x-12">
          <li><Link to="/" className="hover:text-gray-300 transition duration-300">Home</Link></li>
          <li><Link to="/about-us" className="hover:text-gray-300 transition duration-300">About Us</Link></li>
          <li><Link to="/policies" className="hover:text-gray-300 transition duration-300">Policies</Link></li>
          <li><Link to="/contact-us" className="hover:text-gray-300 transition duration-300">Contact Us</Link></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
